description:
Функциональность:
•   Управление платежами (fm);
•   Управление материальными потоками в части ведения бухгалтерского учета (мм);
•   Сбыт основной продукции (SD);
•   Финансовая бухгалтерия (FI);
•   Учет основных средств и нематериальных активов (FI-aa, CO);
•   Учет затрат и расходов (FI, со);
•   Контроль и анализ затрат (со);
•   Реализация налогового учета в соответствии с требованиями 25 главы нк рф (FI-sl, FI, CO);
•   Реализация параллельного учета в соответствии с требованиями us GAAP;
•   Разработка отчетов и интерфейсных программ (авар).
Реализованы бухгалтерский учет; налоговый учет;  учёт по us GAAP;  мто; сбыт готовой продукции.

Участие в разработке типового проектного решения по ПБУ 18/02:
Передача накопленных знаний по учету разниц на предыдущих проектах SAP;
Разработка налоговых регистров учета разниц по ПБУ 18/02 в части учета амортизируемого имущества (FI-aa), расходов, доходов (FI-sl).

Финансовая бухгалтерия (FI); 
Учет основных средств (FI-aa); 
Контроллинг (CO); 
Специальная книга (специальные регистры) (FI-sl).

Управление мто, бухгалтерский и налоговый учет:
• Координация управления (BW, sem);
• Управление мто (MM, SD);
• Управление финансами и бухгалтерский  учет (FI, TR, FI-aa);
• Управление затратами (CO);
• Управление инвестициями (IM).
Тиражирование и развитие системы в филиалах:  
• Тиражирование решений по реализации процессов мто в отделения умтс в гг. ленск, усть-кут, удачный, айхал;
• Реализация управленческой отчетности по движению и остаткам ТМЦ в умтс.

